import React from 'react';
import logo from './ms_logo.png';
import './App.css';

function App() {

  return (
    <div  className="App">
      <header className="App-header">

           <img src={logo} className="App-logo" alt="logo" width={200} height={200}/>
        <p>
          Please produce an ID to the Lobby Host
        </p>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Re-register
        </a>
      </header>
    </div>
  );
}

export default App;
